import React from "react";
import { useState } from "react";
import '../style.css';
import * as color from '../colors.js';
function Import(){
    return(
        <>
            <div style={{
            width:"100%"
            }}>
                <div>
                    <h2 style={{marginTop:"0",color:color.contrast}}>DASHBOARD</h2>
                </div>
                <div style={{
                    margin:"auto",
                    marginTop:"4em"
                }}>
                    contens
                </div>
            </div>
        </>
    );
}
export default Import;
